import React, { useState } from 'react'

const AddCategory = () => {

    const [inputValue, setInputValue] = useState('Texto de ejemplo');

    const changeInputValue = (evt => {
        setInputValue(evt.target.value);
    })

    return (
        <>
            <input
                type='text'
                value={inputValue}
                onChange={changeInputValue}
            />
        </>
    )
}

export default AddCategory;
